import React, { Component } from 'react'

export class ShowDesc extends Component {
  render() {
    return (
      <div className='full-item'>
        <image src='./img/zac.png'></image>
        <div className='item' onClick={() => this.props.onShowItem(this.props.item)}>{this.props.items.desc}</div>
      </div>
    )
  }
}

export default ShowDesc
